import React, { useState } from 'react';

import AddToDo from '../components/add-to-do';

const Index = () => {
  const [todo, setTodo] = useState([]);

  return (
    <>
      <AddToDo setTodo={(todo, setTodo)} />
    </>
  );
};

export default Index;
